// Category.js
import React from 'react';
import QuizCard from '../components/QuizCard';  // Import path for QuizCard
import './css/HomePage.cssCategory.css';                   // Import path for Category.css

const Category = ({ title }) => {
    return (
        <div className="category">
            <h2>{title}</h2>
            <div className="quiz-cards">
                {/* Example Quiz Cards */}
                <QuizCard title="Around the World" questions={8} plays="80k" />
                <QuizCard title="True or False" questions={12} plays="129k" />
                <QuizCard title="Animal" questions={12} plays="129k" />
                <QuizCard title="Car" questions={12} plays="129k" />
                <QuizCard title="Fruit" questions={12} plays="129k" />
                {/* Add more cards as needed */}
            </div>
        </div>
    );
};

export default Category;
